import React from 'react';
import '../style/LogIn.css';

import { NavLink } from 'react-router-dom';


function LogIn() {
    return (
        <div>
            {/* <div className='background_rectangle'> */}
            <div className='wrapper_for_nice_picture'>
                <div className='login_items'>
                    <input className='login_item' placeholder=' username'/>
                    <input className='login_item' placeholder=' password' secureTextEntry={true} />
                    {/* <TextInput secureTextEntry={true} style={styles.textInput} className='login_item' placeholder=' password' /> */}
                </div>

                <div className='buttons_wrapper'>
                    <div className='log_in'>
                        log in
                    </div>
                    Don't have an account? Already have an account? <NavLink className="navbar-item" activeClassName="is-active" to="/signup" exact>Sign up!</NavLink>
                    {/* <div className='sign_up'>
                        sign up
                    </div> */}
                </div>
            </div>
        </div>
        // </div>
    )
}

export default LogIn;
